using System.Collections.Generic;
using System.Linq;
using Microsoft.AspNetCore.Builder;
using Microsoft.Extensions.DependencyInjection;
using OnlineStore.Catalog.Data;
using OnlineStore.Catalog.Data.Models;

namespace OnlineStore.Catalog.Infrastructure
{
    public static class ApplicationBuilderExtensions
    {
        private static IEnumerable<Product> GetPlantProductsData(Category category)
            => new[]
            {
                new Product
                {
                    Name = "Monstera Adansonii",
                    Price = 10,
                    CategoryId = category.Id,
                    Category = category,
                    Quantity = 8,
                    ImageBase64 = "data:image/jpeg;base64,"
                },
                new Product
                {
                    Name = "String of Pearls",
                    Price = 9.90m,
                    CategoryId = category.Id,
                    Category = category,
                    Quantity = 5,
                    ImageBase64 = "data:image/jpeg;base64,"
                },
                new Product
                {
                    Name = "Syngonium Neon",
                    Price = 9.90m,
                    CategoryId = category.Id,
                    Category = category,
                    Quantity = 10,
                    ImageBase64 = "data:image/jpeg;base64,"
                },
                new Product
                {
                    Name = "Monstera Deliciosa",
                    Price = 39.90m,
                    CategoryId = category.Id,
                    Category = category,
                    Quantity = 6,
                    ImageBase64 = "data:image/jpeg;base64,"
                },
                new Product
                {
                    Name = "String of Hearts",
                    Price = 9.90m,
                    CategoryId = category.Id,
                    Category = category,
                    Quantity = 15,
                    ImageBase64 = "data:image/jpeg;base64,"
                }
            };

        private static IEnumerable<Product> GetAccessoriesProductsData(Category category)
            => new[]
            {
                new Product
                {
                    Name = "Penny Pot",
                    Price = 11.8m,
                    CategoryId = category.Id,
                    Category = category,
                    Quantity = 8,
                    ImageBase64 = "data:image/jpeg;base64,"
                },
                new Product
                {
                    Name = "Terracotta Pot",
                    Price = 9.90m,
                    CategoryId = category.Id,
                    Category = category,
                    Quantity = 5,
                    ImageBase64 = "data:image/jpeg;base64,"
                }
            };

        public static IApplicationBuilder SeedData(this IApplicationBuilder app)
        {
            using var serviceScope = app.ApplicationServices.CreateScope();
            var serviceProvider = serviceScope.ServiceProvider;

            var db = serviceProvider.GetRequiredService<CatalogDbContext>();

            if (db.Categories.Any())
            {
                return app;
            }

            var plantsCategory = new Category {Name = "Plants"};

            db.Categories.Add(plantsCategory);

            db.Products.AddRange(GetPlantProductsData(plantsCategory));

            var accessoriesCategory = new Category {Name = "Accessories"};

            db.Categories.Add(accessoriesCategory);

            db.Products.AddRange(GetAccessoriesProductsData(accessoriesCategory));

            db.SaveChanges();

            return app;
        }
    }
}
